import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [docs, setDocs] = useState([]);
  const [title, setTitle] = useState('');
  const [content, setContent] = useState('');
  const [editingId, setEditingId] = useState(null);
  const [editTitle, setEditTitle] = useState('');
  const [editContent, setEditContent] = useState('');

  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  // ⛔ Redirect if no token
  useEffect(() => {
    if (!token) navigate('/login');
  }, [navigate, token]);

  // 📄 Load all documents
  const fetchDocs = async () => {
    try {
      const res = await axios.get('/api/docs', {
        headers: { Authorization: token }
      });
      setDocs(res.data);
    } catch (err) {
      alert('❌ Failed to fetch documents');
    }
  };

  useEffect(() => {
    fetchDocs();
  }, []);

  // ➕ Create new document
  const createDoc = async () => {
    if (!title || !content) return alert('Enter title and content!');
    try {
      await axios.post('/api/docs', { title, content }, {
        headers: { Authorization: token }
      });
      setTitle('');
      setContent('');
      fetchDocs();
    } catch (err) {
      alert('❌ Error creating document');
    }
  };

  // 🗑 Delete document
  const deleteDoc = async (id) => {
    try {
      await axios.delete(`/api/docs/${id}`, {
        headers: { Authorization: token }
      });
      fetchDocs();
    } catch (err) {
      alert('❌ Failed to delete document');
    }
  };

  // ✏️ Start editing
  const startEditing = (doc) => {
    setEditingId(doc._id);
    setEditTitle(doc.title);
    setEditContent(doc.content);
  };

  // 💾 Save updated document
  const updateDoc = async () => {
    try {
      await axios.put(`/api/docs/${editingId}`, {
        title: editTitle,
        content: editContent
      }, {
        headers: { Authorization: token }
      });
      setEditingId(null);
      fetchDocs();
    } catch (err) {
      alert('❌ Failed to update document');
    }
  };

  // 🚪 Logout
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>📄 My Documents</h2>
      <button onClick={handleLogout} style={{ float: 'right' }}>🚪 Logout</button>

      <h3>Create New Document</h3>
      <input
        placeholder="Title"
        value={title}
        onChange={(e) => setTitle(e.target.value)}
      /><br /><br />
      <textarea
        placeholder="Content"
        value={content}
        onChange={(e) => setContent(e.target.value)}
        rows={4}
        cols={40}
      /><br /><br />
      <button onClick={createDoc}>➕ Create Document</button>

      <hr />

      <h3>Your Documents</h3>
      <ul>
        {docs.map(doc => (
          <li key={doc._id} style={{ marginBottom: '2rem' }}>
            {editingId === doc._id ? (
              <>
                <input
                  value={editTitle}
                  onChange={(e) => setEditTitle(e.target.value)}
                /><br />
                <textarea
                  value={editContent}
                  onChange={(e) => setEditContent(e.target.value)}
                  rows={4}
                  cols={40}
                /><br />
                <button onClick={updateDoc}>💾 Save</button>
                <button onClick={() => setEditingId(null)}>❌ Cancel</button>
              </>
            ) : (
              <>
                <h4>{doc.title}</h4>
                <p>{doc.content}</p>
                <button onClick={() => startEditing(doc)}>✏️ Edit</button>
                <button onClick={() => deleteDoc(doc._id)}>🗑 Delete</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Dashboard;
